import React, { Component } from "react";
import Card from "../card/Card";
import "./layout.css";
import Input from "../input/Input";
export default class Layout extends Component {
    render() {
        return (
            <div className="container">
                <Input onChange={() => alert("test")} />
                {<Card />}
            </div>
        );
    }
}
